import React, { Component } from 'react';
import Arthur from './Arthur.png'

class Team extends Component {
  render() {
    return (
      <div class="col-lg-4 col-sm-6">
        <div class="team-card-style-1 mx-auto">
          <div class="team-card-inner">
            <div class="team-thumb"><img className="img-thumbnail" src={this.props.foto} />
            </div>
            <div class="team-social-bar text-center"><a class="social-btn sb-style-4 sb-github" href="#"><i class="socicon-github"></i></a></div><a href="#"><i class="fab fa-linkedin"></i></a>
          </div><span class="team-position">{this.props.funcao}</span>
          <h4 class="team-name">{this.props.nome}</h4>
        </div>
      </div>
    )
  }
}

export default Team;
